import "../Css-files/home.css"
import facade from "../apiFacade"
import React, { useEffect, useState } from 'react';

export default function Home() {



  const fetch = ( ) => {
    facade.fetchDummyData()
    .then((data ) => console.log(data))
  }

  return (
<div>  

  <h1 className="title"> Looking for a specific food or destination? Let <span className="logo">TravelEat </span> help! </h1>

  <div className="container"> 
      <div>    
        <input className="searchContainer" type="text" placeholder="Food or Destination"></input>
      </div>
  </div>
        <button className="searchButton" type="button" onClick={fetch} >Search</button>
        <div id="result" className="returnedResult" ></div>
</div> 
  );
  }
